import React, {Fragment} from "react";
import './App.css';

import SearchAppartment from "./components/js/SearchAppartment";
import InputAppartment from "./components/js/InputAppartment";
import DetailAppartment from "./components/js/DetailAppartment";
import Navbar from "./components/js/Navbar";
import Home from "./components/js/Home";
import About from "./components/js/About";

import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";


function App() {
  return (
      <Router>
          <div className="grid-container">

              <header className="row">
                  <div>
                      <a className="name" href="/">LivinLyon</a>
                      <p>Make finding your next appartment easy!</p>
                  </div>
                  <div className="link">
                      <a href="/">Click to add your appartment</a>

                  </div>
              </header>
              <main>
          <Switch>
            <Route path="/detail" exact component={() => <DetailAppartment />} />
            <Route path="/about" exact component={() => <About />} />
            <Route path="/" exact component={() => <Home />} />


          </Switch>
              </main>
          <footer className="row center">
              All right reserved
          </footer>
          </div>
      </Router>

  )
}

export default App;
